import React from "react";

const SigninNum = ({ mobileNumber, setMobileNumber }) => {
  const inputsHandler = (name) => (e) => {
    setMobileNumber(e.target.value);
  };
  return (
    <>
      <div className="enter-mob-inner-div">
        <div>
          <label for="mob">Enter your mobile number</label>
        </div>
        <div className="enter-mob-input">
          <div>
            <select name="mobpin" id="">
              <option value="91">in</option>
              <option value="92">pk</option>
            </select>
          </div>
          <div className="mobpin2">
            <div>+91|</div>
            <input
              type="number"
              id="mob"
              placeholder="Mobile number"
              value={mobileNumber}
              onChange={inputsHandler("phone")}
            />
          </div>
        </div>
        <div className="verify">
          <h6>To verify your mobile no, We will send you confirmation code</h6>
        </div>
      </div>
    </>
  );
};

export default SigninNum;
